import Link from 'next/link'
const Navbar = () => {
  return (
    <div className="navbar-area">
      <ul>
        <li>
          <Link href="/">
            <a href="">Home</a>
          </Link>
        </li>
        <li>
          <Link href="/about">
            <a href="">About</a>
          </Link>
        </li>
      </ul>
      <style jsx>{`
        ul {
          background: #333;
          color: #fff;
          list-style: none;
          display: flex;
        }
        ul li {
          font-size: 20px;
          margin-right: 20px;
        }
        ul li a {
          color: #fff;
          text-decoration: none;
        }
      `}</style>
    </div>
  )
}
export default Navbar
